INSERT INTO review VALUES(592, 347, 5, 'Amul 99% cacao is the best dark/bitter chocolate available in India... excellent innovation by Amul. I may tell that I am not endorsing Amul or any other brand...just my own opinions. It has been proven that cacao is one of the healthiest superfoods on earth with amazing health benefits. Its full of antioxidants  flavonoids which increase lifespan. Its one of the highest sources of nitric oxide which dilates/widens  relaxes blood vessels of the body by reducing blockages, thereby supporting heart  brain health. Cacao is also anti inflammatory and anti carcinogenic, thus reduces cancer risk. Moreover, cacao is a natural blood thinner, so can prevent blood clots, reduce blood cholesterol  blood sugar and lower blood pressure. Overall Amul dark cacao chocolate has enormous health benefits...so we must be thankful to Amul for making such an awesome health food. Please ignore the negative and one star rated reviews as those people are ignorant and lack awareness. Requesting all the sugar lovers...please dont defame such a nice and healthy product by giving negative ratings and one star. I pity those innocent sweet toothed people which focus on tongue taste rather than general health. Again, I am not promoting Amul company or a representative of the same, these are my personal views  experience. Those who want to enhance quality of life and reduce onset of lifestyle/genetic diseases like cancer, diabetes, hypertension, stroke, heart attacks, cardiac arrest, etc must not think twice...just purchase the stuff  enjoy. Infact, Amul 99% Cacao Chocolate is a heavenly bliss with irresistible taste. It is indeed Delightful  Ambrosial. I am giving a five star rating to this authentic product...if there were 10 stars, I would have given full 10/10. Lastly, thanks to Amul  Amazon, too for providing such a nice superfood at my doorstep.');
