INSERT INTO review VALUES(1191, 63, 5, 'I have to thank the amazon recommendation engine for suggesting the mysore sandal talc. I never knew mysore sandal brand had a talc! I had purchased mysore sandal soap few weeks back and perhaps due to this purchase amazon would have recommended this as well. Glad I clicked the suggestion and bought one of these! Its good bye to my existing Ponds Sandalwood talc !This review compares Mysore sandal talc vis-a-vis Ponds Sandalwood talcPros-1. The Fragrance is the first thing which hits you as soon as you open the bottle. Its smells pure authentic sandal wood than the perfumed ponds talc powder2. The mysore sandal talc allows you to decide the size of the hole you want to have on the bottle. Ponds one forces you to have 3 holes as soon as you want the top cover. I always hated this with the ponds talc. Ponds really wants you to use more than what you need!3. The fragrance last longer than the ponds sandalwood talc even though out the day! Believe it or not - you have to try one and be the judge!4. Some reviews talk about the powder not been finely powdered. Nothing like that - the powder is as fine as its with Ponds sandalwood talc. No more no less!5. The bottle is sealed with a hologram sticker - thats assurance of genuine product from mysore sandal!6. Somehow I like the press-fit top of the bottle to keep the fragrance intact in the bottle when not in use! Ponds bottle was a twist to close top which is not really a seal tight way of shutting close the bottle7. Last but not the least- mysore sandal talc is 50% cheaper than Ponds sandalwood - why on earth would I ever buy Ponds again?Cons-None that i spotted yet');
INSERT INTO vanzare VALUES(1192, 9, 120, TO_DATE('2018-06-26 21:30:49', 'YYYY-MM-DD HH24:MI:SS'), 3825485);
INSERT INTO continutvanzare VALUES(1192, 132, 765097, 5);
INSERT INTO review VALUES(1192, 132, 5, 'Very effective. Active ingredients are  quaternary ammonium chloride compounds which are a very potent and effective disinfectant - you can find these in most non-bleach disinfectant solutions. This is not the same as Dettol antiseptic used for skin so do not use it for that purpose. I am glad that Dettol introduced this as it was difficult to find purpose-made disinfectant concentrates of this formulation - the alternative was Amway Pursue which is not only much more expensive but would involve the hassle of dealing with a pushy Amway salesperson. Anyways, this one has a strong menthol smell and a highly effective disinfectant so fantastic for household use. Also works for laundry, but use it as a pre-wash, with a full wash cycle afterwards to clean out any residues.Also, a word of caution with this and any other disinfectants - please use it wisely and not indiscriminately as overuse not only can damage the environment but kill of beneficial microorganisms and cause harmful ones to develop resistance.');
