INSERT INTO review VALUES(1606, 354, 4, 'This product from patanjali can be a nightmare for your skin. Although the fragrance is good and it is a cheap product but thats all. I have normal skin and am not very prone to pimples. But after applying this gel for a couple of days, I started having pimples on my face. First I ignored, thinking it could be a result of the weather. But then the pimples started increasing. I immediately discontinued the product. But still I am unable to get rid of the pimples.');
