INSERT INTO review VALUES(1612, 66, 4, 'Ive ordered it 3 times and likely to order again. Unlike the 400ml Himalaya gentle baby shampoo or gentle baby bath which has no seals, this lotion comes in clear laminated sealed pack and Ive received it in good condition and packing all the 3 times I ordered. Although its tad light its okay for baby skin. I love its fragrance, leaves my baby smelling nice and I use it myself too but its too light for my dry skin,but of course its meant mainly for babies.One winning feature about this particular 400ml pack is its pump feature,makes it lot easier to literally use it singlehandedly which comes in real handy if youve to hold a squirming wriggling baby with your other hand!Update : Ive ordered my 9th bottle! Initially seller give one bottle but nowadays the minimum quantity is 2 bottles. But its okay,your baby is going to use it every day and they come with very good shelf life so you finish them long before its expiry date.');
