INSERT INTO review VALUES(1658, 260, 5, 'Overall Price is WORTH IT!Fits Laptop upto 14.1â€?, Helmet smaller size only, fruits and vegetable all can be put without issues. Looks pretty decent for your home!But;1. Smells horrible after every cycle (room gets polluted)2. One rack means effectively you can place 10-12 soaps.3. If you over stack them no disinfection possible. Take caution and do less and more cycles to ensure4. One switch operation (plug  play). Timer is to be followed manually or wait for beep (no display if you are curious to know what time has lapsed)5. Wire is three pin, so the earthing is critical, I felt some mild shocks.');
