INSERT INTO review VALUES(1726, 135, 4, 'First impression : lathers very poorly. Its like applying lotion and washing it off. But well lack of foam doesnt necessarily mean its not cleaning my skin.Second impression after washing : mmm skin does feel better,will try using it againFinal impression after using it some more : Very good . It really does moisturize your skin. Perfect for dry skin, specially in harsh winter.Ive very dry and sensitive skin so i need a very good moisturising  skin care routine specially in winter months. My sensitive skin does not agree with random products bought off the shelf. I tried this in 100ml tube as its herbal and I liked as it really does moisturize my dry skin so I bought this 200ml pack from Amazon.I removed a star though as its outlet is so big ,a very generous amount plops out in single pump and you end up finishing it up way faster as compared to other face wash( the 100ml tube had a very generous outlet too).');
