INSERT INTO review VALUES(1941, 323, 4, 'I really love services of amazon their delivery their return policy their  packing.Their service towards their customers its applicable.Now product- 3.5 star  Average plus product. odour of the material i didnt like. It smells like medicated facewash. I dont know whether it fights with acne or pimple. I wasnt having any pimple or acne issues but only for concern i switched to herbal facewash and first i picked aroma magic tea tree oil face which was good i applied it on my face for several months but suddenly some acne and pimple attack on my face i didnt know the cause and then i switched to mamaearth face wash but it did nothing on my face used it for 15 days no result i got. Both the product were fail to cure my pimple or acneI dont know what kind of pimple attack it was. only two or three pimple used to occur after healing that again two or three. OMG finally i consulted to doctor.Both the product i purchased with recommandation of fit tuber on YouTube.If your face is free of pimples or acne then you can use these products by replacing chemical products. But if youre suffering from pimples or acne i dont know both the facewashes will work or not. Because everybody has their own skin and their own causes of occuring pimples or acnes.You can buy and try.');
INSERT INTO continutvanzare VALUES(1941, 32, 639442, 5);
INSERT INTO review VALUES(1941, 32, 5, 'Review of maggi:Who am I to review Maggi. Its iconic for anyone born in the 80s and 90s.Review of this pack:1) better than large packs that you have to store in the open2) Lasts longer than regular pack of eight, again because its closed.Disadvantage :More plastic usage than regular pack or tenConclusion:If you are going to consume Maggi over longer period of time but this one, if you will finish pack of ten within a week buy the regular large packs as it saves plastic pollution--');
