INSERT INTO review VALUES(2210, 230, 5, 'Godrej No. 1 is one of those soaps that has been able to balance all the essential tick points in a common bath soap viz pleasant fragrance, good lather, soft on the skin (I use this during Delhi winters and while some soaps leads to skin drying, Godrej No. 1 leaves the skin soft and moisturized) and economical.I personally love the Lime fragrance but all the other ones are good too and it boils down to an individual preference. Irrespective of the fragrance it will not disappoint. Highly recommend.If you find this review useful then please press the "Helpful" button. Thanks.');
