INSERT INTO review VALUES(2235, 203, 5, 'If you have maids in the house and want to keep valuables like wallets and regular use small jewellery under lock and key while they go about their household chores and you dont want to carry physical keys either for fear of misplacing and searching for them or simply inconvenient for you, then this is the product to go for. Its small enough to sit on your study table or fit in your cupboard drawer..although you must understand That it cant fit more than 3 or 4 regular size mens wallets and some other knickknacks like ear rings, chains, cards etc. Easy to operate and install by reading instructions in manual. Sturdy enough to dissuade servants from physical tampering. Serves purpose for what it is intended to do.');
