INSERT INTO continutvanzare VALUES(2767, 315, 122620, 9);
INSERT INTO review VALUES(2767, 315, 5, 'Great taste. Bought it for my parents as they prefer mild teas and it is great for both mild and strong teas. We add a bit more leaves to make it strong. Most teas in Kerala have a flowery taste and they are not good for masala chai. This purchase solved that issue. Its great as a black tea as well. Just dont boil it while making black tea. Boil the leaves only for masala chai.');
