INSERT INTO continutvanzare VALUES(2771, 149, 266787, 1);
INSERT INTO review VALUES(2771, 149, 4, 'Someone like me had always fancied upon getting some of my hair getting coloured when I see some people with colored or highlighted hair.Going to parlor or salon has always been hard on budget if you are living in a working middle class family.Finally I decided to get 2 packets of this hair highlighter after doing some research and surfing various Youtube videos.Coming to this product let me review as under:Pros:1  Gives good color/highlights if kept for about 45 minutes. (note: 30 minutes is not enough if you have dark black hair).2 The color stays for about 8-9 months and lightens with time.3 After about 1-1.5 months of applying this hair color, I would suggest to use henna/mehendi for about 1 hour in all you hairs...which will not only nourish your hair, but also give very good result for highlighted hairs.4 Personal tip- If you are not satisfied with colored/highlighted hair and want to remove it, use anti-dandruff shampoo 3-4 times while washing your hair. Also the Godrej hair dye (black) available in powder sachet is also effective in removing the highlights.Cons:1 One sachet is not enough even for short hair. Purchase 2 sachets if you want proper results. (note: if you are a girl with shoulder length hair or more, I would suggest 3 sachets).2 Does not give too much highlighted effect if you want to get noticed from others with normal hair.3 Just like any other chemical hair color, it damages you hair and makes your hair rough.Verdict:It is ok to give this a try once if you want to color/highlight your hair at home. I would rather suggest spending few bucks and get your hair highlighted in parlor or salon for better results.If you find my review helpful, please click the YES/HELPFUL button! ');
