INSERT INTO review VALUES(2782, 384, 5, 'I bought this on a lark and it had been sitting on a shelf for a very long time. Till I developed warts on my chin. No amount of pulling and scrubbing helped and I was reluctant to use over-the-counter wart paint because of all the pharma warnings on them.I decided to use this clay on the warts, covering them with a generous coat of the clay twice a day and kept it on day and night for a month. Voila!I had to be patient but a month of application fixed my skin. Whatever this face pack contains, it is extremely effective. I used to a feel a constant sting after application but it can be ignored. The best part is that it didnt affect healthy skin adversely unlike wart paints which require precautions.Caution - These warts werent because of an STD. I probably picked them up at the gym or some other place with too many people milling around in sweat. Please seek your doctors advice if you have an STD. This face pack should not be applied on your eyelids or where you have a chance of ingesting it. Read disclaimers on the package.');
