INSERT INTO review VALUES(2822, 123, 1, 'Bought godrej goldilock in the Amazon diwali sale.. In The product that I got,was having some scratches already. Still I kept it.  I wanted to disable the theft alarm because it gives a loud sound even if we move the goldilock slightly, which is very annoying. I tried to disable the feature but it was not getting disabled. The godrej executive also couldnt do it.. He told some problem is there in pcb and I should return the product.. I did it.. I got the product replaced by Amazon the very next day...Now the new product also has same problem. We cannot disable the alarm. Also it has one additional problem...when we close its lid, it sometimes doesnt get locked. After 2-3 attempts, it gets locked..Now I am confused, what to do with this.. I trusted godrej brand and Amazon.. But the satisfaction level is not at all there');
